class AllCategoriesModel {
  AllCategoriesModel({
    dynamic id,
    dynamic title,
    dynamic image,
    dynamic productsCount,
    List<Products>? products,
  }) {
    _id = id;
    _title = title;
    _image = image;
    _productsCount = productsCount;
    _products = products;
  }

  AllCategoriesModel.fromJson(dynamic json) {
    _id = json['id'];
    _title = json['title'];
    _image = json['image'];
    _productsCount = json['products_count'];
    if (json['products'] != null) {
      _products = [];
      json['products'].forEach((v) {
        _products?.add(Products.fromJson(v));
      });
    }else{
      _products = [];
    }
  }

  dynamic? _id;
  dynamic? _title;
  dynamic? _image;
  dynamic? _productsCount;
  List<Products>? _products;

  dynamic? get id => _id;

  dynamic? get title => _title;

  dynamic? get image => _image;

  dynamic? get productsCount => _productsCount;

  List<Products>? get products => _products;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['id'] = _id;
    map['title'] = _title;
    map['image'] = _image;
    map['products_count'] = _productsCount;
    if (_products != null) {
      map['products'] = _products?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

